import React from 'react';
import {Card,Image, Icon} from 'semantic-ui-react';



import { IAffilie } from '../../../app/models/affilie';

const AffilieListItem: React.FC<{ affilie: IAffilie }> = ({ affilie }) => {
  //const host = affilie.attendees.filter(x => x.isHost)[0];
  return (
    <Card>
    <Image src='https://react.semantic-ui.com/images/avatar/large/matthew.png' wrapped ui={false} />
    <Card.Content>
    <Card.Header>{affilie.nom} {affilie.prenom}</Card.Header>
      <Card.Meta>
      {affilie.rest > 0 ? (
          <span className='date' color="Red">{affilie.rest}</span>
        ) : (
          <span className='date' color="Green">{affilie.rest}</span>
        )}

      </Card.Meta>
      <Card.Description>
        Matthew is a musician living in Nashville.
      </Card.Description>
    </Card.Content>
    <Card.Content extra>

        <Icon name='map marker alternate' />
        {affilie.adresse}

    </Card.Content>
  </Card>
  );
};

export default AffilieListItem;
